import React from "react";

const cardClub = (props) => {
  const membersClub = props.members.map((item, index) => {
    return <li key={index}> {item}</li>;
  });
  return (
    <li>
      <h2> </h2>
      <ul>
        <li></li>
      </ul>
    </li>
  );
};

export default cardClub;
